 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 03:51:10', '2017-01-24 04:36:12', '4d1265f1-bff7-4bc4-ae0a-230b85924c15'),
 ('2', '2', 'en_us', 'Home', '<p>Treno Ristorante is an upscale Italian restaurant located in the historical train depot overlooking the Cuyahoga River in Downtown Kent, Ohio. Formerly the Pufferbelly Restaurant, the depot recently underwent a transformative renovation of its space, and is now open for lunch and dinner.\n  </p>\n<p>Treno lends a cultural charm where past meets present and classic meets contemporary; where patrons will feel included and part of the dining experience; and where exquisite service is not a welcome change, but always the standard.   </p>\n<p>Treno’s menu is focused on classic Italian cuisine with dishes prepared in house from scratch with fresh, flavorful ingredients including locally sourced products as available. We invite you to enjoy a delicious lunch or memorable evening out featuring exquisitely prepared authentic Italian fare complemented by a thoughtful wine list and full bar selection.    </p>\n<h3>Spero di Vederti!</h3>', NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, 'Welcome', 'to Kents', 'Ristorante', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 03:51:11', '2017-11-09 19:12:32', '0f06c49f-ff28-4cd1-ab90-c62ed1e135f3'),
 ('5', '5', 'en_us', 'Antipasti', NULL, NULL, '0.00', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Appetizers', NULL, NULL, NULL, NULL, '2017-01-24 15:31:16', '2017-09-26 20:18:21', '2f6defa7-8e1b-4355-b7ce-0ee2cbbfd367'),
 ('6', '6', 'en_us', 'Steak', NULL, 'Description of the Food', '20.00', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '[\"rawUndercooked\"]', NULL, NULL, NULL, NULL, NULL, '2017-01-24 15:33:41', '2017-09-26 20:39:41', '092670ab-38c8-4a78-80f6-d08fd2c0fe10'),
 ('7', '7', 'en_us', 'Idea Base Logo Horizontal Color', NULL, NULL, '0.00', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-01-24 15:43:59', '2017-01-24 15:43:59', '92bf1832-9553-40d9-98f5-d913b8d67093'),
 ('8', '8', 'en_us', 'About Treno', '<p>Treno is a new website that is opening in Kent Ohio in May of 2017</p>', NULL, '0.00', 'History', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '<p>Treno Ristorante, an upscale Italian restaurant, will be located in the historical train depot overlooking the Cuyahoga River in Downtown Kent, Ohio. Formerly the Pufferbelly Restaurant, the depot is currently undergoing a transformative renovation of its space, and the restaurant will be opening this summer 2017.</p>\n<p><br />Treno will lend a cultural charm where patrons will feel included and part of the dining experience. With a menu focused on Northern Italian cuisine, our dishes will be prepared in house from scratch with fresh, flavorful ingredients including locally sourced products as available. We invite you to enjoy a memorable evening out or delicious lunch featuring exquisitely-prepared authentic Italian fare complemented by a thoughtful wine list and full bar selection.</p>', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"en_us\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"About Treno\",\"seoDescription\":\"\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"About Treno\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"custom\",\"seoDescr