 ('10', '10', 'en_us', NULL, NULL, NULL, '0.00', '152 Franklin Ave. Kent, Ohio 44240', NULL, '0', 'hello@trenokent.com', '[{\"col1\":\"Mon-Thurs\",\"col2\":\"11a.m.-10p.m.\"},{\"col1\":\"Friday\",\"col2\":\"11a.m.-11p.m.\"},{\"col1\":\"Saturday\",\"col2\":\"Noon - 11pm\"},{\"col1\":\"Sunday\",\"col2\":\"Closed\"}]', '(###)-###-####', NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, 'Treno Ristorante all rights reserved', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>A 20% gratuity will be added to parties of ten or more.</p>\n<p>To our guests with good sensitivities or allergies, please consider when ordering that Trend cannot fully ensure that all menu items do not contain ingredients that might cause a reaction.</p>\n<p>*These items may be served raw or undercooked, or may contain raw or undercooked ingredients. Consuming raw or undercooked meats, poultry, seafood, shellfish, or eggs may increase your risk of food borne illness. </p>', NULL, NULL, NULL, '2017-01-24 16:31:35', '2017-10-17 20:30:46', '6f84c735-51b9-4172-9e30-4f4522e2c7f8'),
