 ('181', '8', '4', '1', 'en_us', '14', '', '{\"typeId\":\"4\",\"authorId\":null,\"title\":\"About Treno\",\"slug\":\"about-treno\",\"postDate\":1488208186,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"30\":\"<p>Treno Ristorante, an upscale Italian restaurant, will be located in the historical train depot overlooking the Cuyahoga River in Downtown Kent, Ohio. Formerly the Pufferbelly Restaurant, the depot is currently undergoing a transformative renovation of its space, and the restaurant will be opening this summer 2017.<\\/p>\\r\\n<p><br>Treno will lend a cultural charm where patrons will feel included and part of the dining experience. With a menu focused on Northern Italian cuisine, our dishes will be prepared in house from scratch with fresh, flavorful ingredients including locally sourced products as available. We invite you to enjoy a memorable evening out or delicious lunch featuring exquisitely-prepared authentic Italian fare complemented by a thoughtful wine list and full bar selection.<\\/p>\",\"8\":\"History\",\"1\":\"<p>Treno is a new website that is opening in Kent Ohio in May of 2017<\\/p>\",\"7\":[\"56\"],\"56\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"\",\"seoDescriptionSource\":\"custom\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"custom\",\"seoImageIdSourceField\":\"featureImage\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"featureImage\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"featureImage\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTr