 ('183', '2', '1', '1', 'en_us', '18', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Home\",\"slug\":\"homepage\",\"postDate\":1485229871,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Treno Ristorante is an upscale Italian restaurant located in the historical train depot overlooking the Cuyahoga River in Downtown Kent, Ohio. Formerly the Pufferbelly Restaurant, the depot recently underwent a transformative renovation of its space, and is now open for lunch and dinner.\\r\\n  <\\/p>\\r\\n<p>Treno lends a cultural charm where past meets present and classic meets contemporary; where patrons will feel included and part of the dining experience; and where exquisite service is not a welcome change, but always the standard.   <\\/p>\\r\\n<p>Treno\\u2019s menu is focused on classic Italian cuisine with dishes prepared in house from scratch with fresh, flavorful ingredients including locally sourced products as available. We invite you to enjoy a delicious lunch or memorable evening out featuring exquisitely prepared authentic Italian fare complemented by a thoughtful wine list and full bar selection.&nbsp;   <\\/p>\\r\\n<h3>Spero di Vederti!<\\/h3>\",\"7\":[\"77\"],\"47\":\"\",\"48\":\"\",\"35\":\"Welcome\",\"36\":\"to Kents\",\"37\":\"Ristorante\",\"34\":[\"79\"],\"29\":[\"76\"],\"38\":[\"66\"]}}', '2017-10-17 19:47:30', '2017-10-17 19:47:30', '765c26c5-6d7d-4944-bcb1-c80594324b31'),
